import React from 'react';
import styled from 'styled-components';

const AuthFoamBlock = styled.div``;

const AuthFoam = () => {
  return (
    <AuthFoamBlock>
      <h3>로그인</h3>
      <form>
        <styledInput
          autoComplete="username"
          name="username"
          placeholder="아이디"
        />
        <styledInput
          autoComplete="new-password"
          name="password"
          placeholder="비밀번호"
          type="password"
        ></styledInput>
      </form>
    </AuthFoamBlock>
  );
};

export default AuthFoam;
